{"content_entity_id": 68276, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 158, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 158, "content_entity_sort_nr": 158, "@timestamp": "2018-11-26T23:25:51.982Z", "client_ip": 3575884035, "comment_count_by_submitter": 9, "quote_reg_count": 0, "comment_subject": "seniil", "comment_content": "Homoteema juurde tagasi tulles ütleksin, et homopropaganda nagu demagoogia kunagi toetub tavalisele mõistete vassimisele, mille õnge on muide läinud ka homofoobid. Segi aetakse seksuaalperverssus ja seksuaalkuritegu. Esimest peaks tabama moraalne hukkamõist, teist politsei ja kohus. Et need on erinevad asjad, tõestab kas või selline näide: heteroseksuaalne mees vägistab heteroseksuaalse naise. Midagi perversset selles ei ole, küll on aga kuritegu. Teiselt poolt, homode suguakt vabatahtlikkuse alusel ei ole kuritegu (perverssuse jätame esialgu lahtiseks). Aga samuti pole kuritegu omaenda kitse keppimine (naabri kitse keppimine, mis kitse piimaandi vähendab, võib olla varavastane kuritegu), perverssuse küsimuse jätame siingi esialgu lahtiseks.\nHomoseksuaalsus (ilma vägistamata) ei ole niisiis kuritegu ja ei kuulu kohtulikule karistamisele. Aga kas ta on moraalselt hukkamõistetav perverssus?\nVõib üldse loobuda perverssuse kategooriast, siis aga juba ka kitsega või laibaga ühtimise puhul. Kui aga mingi piir vahele tõmmata, siis ainus loogiliselt põhjendatud viis seda teha on heteroseksuaalsuse ja muude orientatsioonide vahele. Normaalne on seksuaalne läbikäimine, mille tulemuseks nullist erineva tõenäosusega võib olla viljastumine, kõik muud on perverssed.\n\nViljastumine teatavasti pole garanteeritud ka kõige loomulikuma seksi korral. Ja ükski rasedusvastane vahend ei anna 100%st garantiid. Seksimine rasedusvastaste vahenditega on küll väga normaalse ja perversse piiri lähedal, aga siiski normaalsel pool piiri. Kui kaugel sealpool piiri on mingi perversne seksuaalkäitumine, see mind ei huvita - nad on kõik moraalselt hukkamõistetavad - aga kohtulikult karistatavad vaid vägivalla esinedes.", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 32689177, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3432866, "publisher_id": 1, "user_id": null, "created_time": "2004-07-24T17:16:29.000Z", "user_sort_nr": null, "comment_content_lemmas": "homoteema juurde tagasi tulema ütlema , et homopropaganda nagu demagoogia kunagi toetuma tavaline mõiste vassimine , mis õng olema muide läinud ka homofoob . segi ajama seksuaalperverssus ja seksuaalkuritegu . esimene pidama tabama moraalne hukkamõist , teine politsei ja kohus . et see olema erinev asi , tõestama kas või selline näide : heteroseksuaalne mees vägistama heteroseksuaalne naine . miski perversne see ei olema , küll olema aga kuritegu . teine poolt , homo suguakt vabatahtlikkus alune ei olema kuritegu ( perverssus jätma esialgu lahtine ). aga samuti olema kuritegu omaenese kits keppimine ( naaber kits keppimine , mis kits piimaand vähendama , võima olema varavastane kuritegu ), perverssus küsimus jätma siin esialgu lahtine . homoseksuaalsus ( ilma vägistama ) ei olema niisiis kuritegu ja ei kuuluma kohtulik karistamine . aga kas tema olema moraalselt hukkamõistetav perverssus ? võima üldse loobuma perverssus kategooria , siis aga juba ka kits või laip ühtimine puhul . kui aga mingi piir vahele tõmbama , siis ainus loogiliselt põhjendama viis see tegema olema heteroseksuaalsus ja muu orientatsioon vahele . normaalne olema seksuaalne läbikäimine , mis tulemus null erinev tõenäosus võima olema viljastumine , kõik muu olema perversne . viljastumine teatavasti olema garanteerima ka kõige loomulikum seks korral . ja ükski rasedusvastane vahend ei andma 100 % st garantii . seksimine rasedusvastane vahend olema küll väga normaalne ja perversne piir lähedal , aga siiski normaalne pool piir . kui kaugel sealpool piir olema mingi perversne seksuaalkäitumine , see mina ei huvitama - tema olema kõik moraalselt hukkamõistetav - aga kohtulikult karistatav vaid vägivald esinema .", "comment_content_clean": {"stats": {"urls": "", "relative_punct": "0_0", "shit_tokens": "", "trigger_words": "", "relative_caps": "0_0", "lang": "et", "text_length": "4", "obfuscated": ""}, "text": "homoteema ütlema , homopropaganda demagoogia toetuma tavaline mõiste vassimine , õng läinud homofoob . segi ajama seksuaalperverssus seksuaalkuritegu . esimene tabama moraalne hukkamõist , politsei kohus . erinev asi , tõestama näide : heteroseksuaalne mees vägistama heteroseksuaalne naine . perversne , kuritegu . , homo suguakt vabatahtlikkus alune kuritegu ( perverssus jätma lahtine ). kuritegu kits keppimine ( naaber kits keppimine , kits piimaand vähendama , varavastane kuritegu ), perverssus küsimus jätma lahtine . homoseksuaalsus ( vägistama ) kuritegu kuuluma kohtulik karistamine . moraalselt hukkamõistetav perverssus ? üldse loobuma perverssus kategooria , kits laip ühtimine . piir tõmbama , ainus loogiliselt põhjendama viis heteroseksuaalsus orientatsioon . normaalne seksuaalne läbikäimine , tulemus null erinev tõenäosus viljastumine , perversne . viljastumine teatavasti garanteerima loomulikum seks . ükski rasedusvastane vahend andma 100 % st garantii . seksimine rasedusvastane vahend normaalne perversne piir , normaalne piir . kaugel piir perversne seksuaalkäitumine , huvitama - moraalselt hukkamõistetav - kohtulikult karistatav vägivald esinema ."}, "texta_facts": [{"spans": "[[0, 0]]", "str_val": "foo", "fact": "TEEMA", "doc_path": "comment_content"}]}
