{"content_entity_id": 68289, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 408, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 408, "content_entity_sort_nr": 408, "@timestamp": "2018-11-26T23:25:51.992Z", "client_ip": 3585345413, "comment_count_by_submitter": 3, "quote_reg_count": 0, "comment_subject": "NB!!!Tähelepanu!!!", "comment_content": "sele perse panemas. nüüd saladust pole ja läheb igavaks - ei tahagi enam.\nHääleta: -2 -1 0 +1 +2\n\nSorts, 24.07.2004 18:23\nto uudistaja, 24.07.2004 18:04\nMiks Sa ei kirjutanud laulu- ja tantsupeoliste kohta _selline enda demonstreerimine on ju sama kui muud ihult või hingelt sandid nõuaks endale paraadi pidamise õigust ainult selleks, et oma puudulikkust demonstreerida_.\nHääleta: -2 -1 0 +1 +2\n\nDr.James Dobson, 24.07.2004 18:25\n*Homoseksualism - mitte alternatiivne elulaad, vaid perverssus, mis ohustab ka asjassepuutumatuid*\n\nJumal poleks Oma tarkuses homoperverssust hukka mõistnud, kui see oleks vaid kellelegi imponeerinud alternatiivne elulaad.\nVastupidiselt laialt levinud seisukohtadele saab pederastiat edukalt ravida, kui inimene meeleheitlikult muutuda püüab.\nPahet pole kerge võita, kuid enamus homoseksualiste võivad muutuda ja rahulduse saada ka eranditult heteroseksuaalsest suhetest.\nHomoseksualistlik propaganda tahab maalida pilti homoseksualismist kui suuresti heteroseksualismile sarnanevast elulaadist.\nKaht noort meest või naist kujutatakse kenasti käsikäes pargis jalutamas, nagu oleks nende perverssus vaid üks inimarmastuse erivorme.\n\nParaku on tegelik homoelu absoluutselt midagi muud - oma äärmustes uskumatult roojane ja väärastunud.\nVäitlusest vastavateemaliste artiklite, intervjuude ja trükiste tõusulaines on selgunud, et homoseksualismist on saanud Läänemaailma peamisi hädaohte tervishoiule*.\nPaljud, ehkki mitte kõik, homoseksualistid eelistavad grupitegevust.\nOrgiad toimuvad muuhulgas homosaunades, mis viimastel aastatel seoses homoseksualismi vastaste seaduste tühistamisega on paljudes kohtades legaliseeritud.\nUSA-s on 200-400 sellist sauna. Nende äriedu on tõsiselt kahjustanud AIDS, kuid need eksisteerivad endiselt.\nKui siseneksite koos homoga seesugusesse asutusse, näeksite järgmist pilti.\nUmbes pooleteise tunni jooksul astuks ta suu-päraku kontakti kümne kui kolmekümne partneriga, saades igaühelt seedimiseks väikesi roojakoguseid; teda läbistataks suu kaudu viie kuni kümne mehe poolt ning ta oleks sama arvu suu-suguti ühte subjektiks.\nKõik need mehed neelaksid üksteise fekaale, mida antakse edasi pärakust peenisele, peeniselt suhu, suust pärakusse jne.\nSee pole liialdus ega ülepakkumine.\nSan Fransiscos korraldatud Kinsey teise uurimuse järgi kinnitavad 83 protsenti homodest, et harrastavad oraal- anaalset seksi.\nVäljaanne Gay Report, mille on kirjutanud homod homodele, hindab protsendiks 89.\nSarnaselt võtab 23 protsenti omaks urineerimise vahekordade vältel üksteisesse.\nSee “alternatiivne elulaad” hõlmab teisigi tegevusi ja tunnuseid, mida ma ei kirjeldaks.\n\nEelpoolnimetatud kirjelduse tõesust kontrollis dr. Donald Tweedie, psühhoterapeut, kes on 25 aastat tegelenud homoseksuaalsete patsientide ravimisega.\nTweedie järgi astuvad isegi need, kes väidavad end olevat monogaamses suhtes, tegelikult vahekorda rohkematega.\nTeiste sõnadega: homoseksuaalsed suhted mitme partneriga on levinud isegi nende puhul, kes äsjakirjeldatud orgiaist hoiduvad.\nSelles on põhjus, miks nii paljud homoseksualistid nakatuvad kollatõppe ja muudesse haigustesse, sh AIDSi, praegu veel ravimatusse tõppe.\nHaiguste Kontrolli Keskuse järgi Atlantas Georgia osariigis on 100 protsenti kõigist 1980. aaastal või varem klassikalise AIDSi sümptomidega diagnoositud patsientidest praeguseks surnud ning nende arv kahekordistub iga poole aasta tagant. Need arengud viitavad rahva tervise pahaendelistele perspektiividele.\nNad puurivad meie hambaid, opereerivad meid, serveerivad meile toitu, õpetavad meie lapsi ja annavad doonoriverd meie haiglates.\nMis tahes suuremat haigust, mis mõjutab kuni kümmet protsenti elanikkonnast, tuleks pidada kogu elanikkonda ohustavaks.\n\nDr. JAMES DOBSON\nUSA perekonnanõustaja", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 30683287, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3433007, "publisher_id": 1, "user_id": null, "created_time": "2004-07-24T19:04:00.000Z", "user_sort_nr": null, "comment_content_lemmas": "sele perse panema . nüüd saladus olema ja minema igav - ei tahtma enam . Hääleta : -2 -1 0 + 1 + 2 sorts , 24.07.2004 18 : 23 to uudistaja , 24.07.2004 18 : 04 miks sina ei kirjutama laul ja tantsupeoline kohta selline ise demonstreerimine olema ju sama kui muu ihk või hing sant nõudma ise paraad pidamine õigus ainult see , et oma puudulikkus demonstreerima . Hääleta : -2 -1 0 + 1 + 2 Dr . James Dobson , 24.07.2004 18 : 25 * homoseksualism - mitte alternatiivne elulaad , vaid perverssus , mis ohustama ka asjassepuutumatu * jumal olema oma tarkus homoperverssus hukka mõistma , kui see olema vaid keegi imponeerima alternatiivne elulaad . vastupidiselt laialt levima seisukoht saama pederastia edukalt ravima , kui inimene meeleheitlikult muutuma püüdma . pahe olema kerge võitma , kuid enamus homoseksualist võima muutuma ja rahuldus saama ka eranditult heteroseksuaalne suhe . homoseksualistlik propaganda tahtma maalima pilt homoseksualism kui suuresti heteroseksualism sarnanev elulaad . kaks noor mees või naine kujutama kenasti käsikäes park jalutama , nagu olema tema perverssus vaid üks inimarmastus erivorm . paraku olema tegelik homoelu absoluutselt miski muu - oma äärmus uskumatult roojane ja väärastuma . väitlus vastavateemaline artikkel , intervjuu ja trükis tõusulaine olema selguma , et homoseksualism olema saama läänemaailm peamine hädaoht tervishoid *. palju , ehkki mitte kõik , homoseksualist eelistama grupitegevus . orgia toimuma muuhulgas homosaun , mis viimane aasta seoses homoseksualism vastane seadus tühistamine olema palju koht legaliseerima . USA olema 200-400 selline saun . tema äriedu olema tõsiselt kahjustama aids , kuid see eksisteerima endiselt . kui sisenema koos homo seesugune asutus , nägema järgmine pilt . umbes poolteist tund jooksul astuma tema suu-pärak kontakt kümme kui kolmkümmend partner , saama igaüks seedimine väike roojakogus ; tema läbistama suu kaudu viis kuni kümme mees poolt ning tema olema sama arv suu-suguti ühe subjekt . kõik see mees neelama üksteise fekaalid , mis andma edasi pärak peenis , peenis suu , suu pärak jne . see olema liialdus ega ülepakkumine . San Fransiscos korraldama Kinsey teine uurimus järgi kinnitama 83 protsent homo , et harrastama oraal anaalne seks . Väljaanne Gay Report , mis olema kirjutama homo homo , hindama protsent 89. sarnaselt võtma 23 protsent oma urineerimine vahekord vältel üksteise . see “ alternatiivne elulaad ” hõlmama teine tegevus ja tunnus , mis mina ei kirjeldama . eelpoolnimetatud kirjeldus tõesus kontrollima dr . Donald Tweedie , psühhoterapeut , kes olema 25 aasta tegelema homoseksuaalne patsient ravimine . Tweedie järgi astuma isegi see , kes väitma ise olema monogaamne suhe , tegelikult vahekord rohkem . teine sõna : homoseksuaalne suhe mitu partner olema levima isegi tema puhul , kes äsjakirjeldatud orgia hoiduma . see olema põhjus , miks nii palju homoseksualist nakatuma kollatõbi ja muu haigus , sh AIDS , praegu veel ravimatu tõbi . haigus kontroll keskus järgi Atlanta Georgia osariik olema 100 protsent kõik 1980. aasta või varem klassikaline AIDS sümptomi diagnoosima patsient praegune surema ning tema arv kahekordistuma iga pool aasta tagant . see areng viitama rahvas tervis pahaendeline perspektiiv . tema puurima mina hammas , opereerima mina , serveerima mina toit , õpetama mina laps ja andma doonoriveri mina haigla . mis tahes suurem haigus , mis mõjutama kuni kümme protsent elanikk