{"content_entity_id": 67067, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 7835, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 7835, "content_entity_sort_nr": 7835, "@timestamp": "2018-11-26T23:25:51.994Z", "client_ip": 1357588402, "comment_count_by_submitter": 1646, "quote_reg_count": 0, "comment_subject": "M.KOHK", "comment_content": "Isand Kohk ei armasta midagi nii kui suvist äikesevihma keset palavat päeva.\nLämbe õhk muutub elektrilaengute mahalaadimisel imeliselt kargeks ja karastavaks.\nKohk kanduks oma vaimusilmas justkui tagasi elu algusaegadesse, kus sähvis äike, mürises kõu ja vesi pulbitses ning auras...\nJust sellest ürgookeanist ning aegade hämarusest, iseenda bioloogilisest mälust saab isend Kohk aimu oma mõtlustes ning askeesis...\n\nKohk otsustas veeta tänase päeva kui lihtne, tavaline inimene.\nRuttamata jalutas ta randa (Penelope ei saanud minna), nautis õhu- ning päikesevanne ning imetles kauneid n..., hm-hmmm.., inimesi .\n\nHiljem aga jalutas läbi metsa hipodroomi poole.\nSeal aga peatasid Kohki kaks vanemat vene daami, kes esitasid retoorilise võtmeküsimuse:\n“Mis te arvate, kas lõpuajad on lähedal”?\nIsand Kohkil on mõistagi oma arvamus, kuid iial, mitte iial ei hakka ta oma seisukohti daamidele peale suruma, seega vastas ta kui kätteõpitud parooli:\n“Muidugi, alates 1914 algasid selle maailma lõpuajad”.\n(Sest Kohki ees olid ju Jehoova Tunnistajad).\nJa Kohk manas näole oma parima euronaeratuse, unustades isegi kojujäänud proteesi!\n”Ja te ei saadagi meid kuhugi kaugemale”, imestas teine daam, ilmselt misjonitöö kurbade kogemuste tõttu.\n”Kas te teate, et ainult üks päev on veel aega jäänud, kaks päeva on kulunud”, küsis esimene eesti keelele üle minnes.\n”Üks aasta on Jumalal võrdne tuhandega maa peal, kaks tuhat on möödunud Jeesuse sünnist”, selgitas ta edasi.\nKohk tõstis pilgu vaguralt taeva poole ja tsiteeris: ”Taevariigis on tuhat aastat nagu üks päev ja üks päev nagu tuhat aastat”.\nEdasi JT ind rauges, Kohk sai Vahitorni aastast 2002- ”Kas pühakud võivad sind aidata?”\n\nEdasi astus Kohk nagu lihtne shoppaja Merimetsa selverisse, kus fuajees üks blond näitsik mesimagusa naeratuse saatel ta peatas ja küsis, soovib Kohk kuuks ajaks tasuta Postimeest tellida, isegi tänane Postimees anti tasuta kaasa.\nKohk soovis, sest miski ei tee Kohki südant nii pehmeks, kui noorte neidude naeratus.\nSelverist väljudes peatas Kohki aga teine, brünett kaunitar ja soovitas ka Postimeest kuuks ajaks tasuta!\nJuba on!\n\nKohkil käib küll EE ja PL, möödunud aastal pakuti talle samuti tasuta Postimeest, kuid vana arm jäi haljaks.\nKohk ostis soodushinnaga Grosso jäätist ning suundus Kristiine keskusesse...\nNii möödus Kohki laupäev ruttamata, inimeste seas.\n\nNii mõnigi küsib nüüd, miks Kohk kirjutab siin usutriidis nii lihtsatest asjadest, miks ei too ta siia oma religioosete mõtluste kvintessentsi?!\n\nJust sellega seoses tahabki isand Kohk oma armsatele del´fiinidele öelda:\nTundke rõõmu elust, tundke rõõmu lihtsatest ja pisikestest asjadest ning sündmustest, elu elatakse iga päev, tund ja sekund- need on kõik teie omad.\n\n/PS, nendele, kes selle läbi lugesid, oligi see kohustuslik lugemisvara:-)/", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 28198660, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3433034, "publisher_id": 1, "user_id": null, "created_time": "2004-07-24T19:17:02.000Z", "user_sort_nr": null, "comment_content_lemmas": "Isand Kohk ei armastama miski nii kui suvine äikesevihm keset palav päev . lämbe õhk muutuma elektrilaeng mahalaadimine imeliselt karge ja karastav . Kohk kanduma oma vaimusilm justkui tagasi elu algusaeg , kus sähvima äike , mürisema kõu ja vesi pulbitsema ning aurama ... just see ürgookean ning aeg hämarus , iseenese bioloogiline mälu saama isend Kohk aim oma mõtlus ning askees ... Kohk ots