{"content_entity_id": 68153, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 425, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 425, "content_entity_sort_nr": 425, "@timestamp": "2018-11-26T23:25:51.664Z", "client_ip": 1381014690, "comment_count_by_submitter": 3, "quote_reg_count": 0, "comment_subject": "Minu arvamusele", "comment_content": "Olen suga taiel maaral nous.Sellist ausammast peaks Eesti Vabariik looma ainult juba enese austamise nimel.Samuti on eestil koik legitiimsed oigused ,et nouda NSV-liidu parijalt,Vene foderatsioonilt,rahalist kompensatsiooni,kuuditatute perekondade,kui ka materiaalse kahju - ,endise eesti Vabariigi maj, aluse laostamise eest.Sedasama on Iisrael teinud Saksamaa suhtes,kui ka USA-ga.Miks siis USA-ga.Paljudel laheb seda lugedes pilt eest ara,aga tegelt,tunnistab USA fiktiivselt oma 30-ndatel tehtud vigu,kui ta esimesi euroopa juudipagulasi eemale t6rjus.Samuti aitas ta ka Natsisaksamaa tugevnemisel,ignoreerides Hitleri anastuslike samme Euroopas.Kui poleks jaapan Pearl Harbouri runnanud,poleks Janki sotta astunud,valjaarvatud Britannia abistamisel.Eestil pole karta midagit.Olles NATOs ja EL-s,kui naiivsena ka see voib tunduda,aga eestil on tugi olemas,ning &quot;Suur Vene&quot; voib ainult karjuda ja rusikatega vehkida,ning mustata eestit.Eestil peaks vastukaaluks hea enesekaitse propaganda osakond valisministeeriumis olema.\nNagu sa tead,oli ka minu perekond 1941 aastal venemaale kuuditatud,mille tulemusena,mu isa ka vaga noorena ara suri.Maletad,kuidas parast soda,eestisse naasunud fonke juudid-tiblajuudid,meile narvidele kaisid.Meie ,eesti juudid ju nendega labi ei kainud.Olime alati eestlastega sama meelt,ning paljud meie juudid kannatasid venemaalt naasunud punajuutidest.Kui palju kannatas minu perekond punajuutide koputajatest,kellele oli kama koik,kas see valjakoputatu oli juut,voi jakuut.Nii ,nagu eestlaste hulgas,oli punamundrite hoorajaid,nii olid ka moned eesti juudid nende ridades.Inimene on liha ja veri,oma omakasupuudlikusega,ning rahvus ei mangi selles mingit rolli.\nMa tean,et 1946 a ,suhtus USA valitsus,hoopis teisiti Eesti SS waffenites teeninud Eestlastesse,kui samades ridades teeninud sakslastesse.USA valitsus nagi neis eestlastes oma kodumaa paastjaid kommunistliku okupatsiooni eest.On isegi teada,et USA armee mobiliseeris eesti waffen ss mehi oma ridadesse.Pentagonis on neile eesti meestele isegi Autahvel pustitatud,mis kahjuks ara poles.11.9.2001 aastal rammis end uks terroristide lennuk just seda sama objekti,kus see autahvel rippus.Saatuse iroonia,eksole?!\nPeab v6tma arvesse,et eesti oli samuti saksa okupatsiooni all,ning mitteallumine 1944a valjakuulutatud uldisele mobilisatsioonile,lohnas automaatselt diserteerumisega,ning mahalaskmisega.Peab votma arvesse,et eestlasel oli ainukene voimalus,et oma isamaad kaitsta,saksa mundris voidelda.Ma ei nae midagi halba selles,kui neile ausammas luuakse.Eesti kultuuri min.peaks siin suurt kultuur-seletustood tegema .Pole mingit oigustust,et eesti sodureid punaarmee mundrites ,vaadeldakse kui &quot;vabastajatena&quot; samas eesti sodureid saksa mundris &quot;kurjategijatena&quot;.Minuarvates,voiks T6nismae Pronkssoduri korvale,ka eesti sodurit paigaldada,olgu siis ta kas saksa mundris,voi jaapani mundris.Need molemad sodurid voitlesid oma kodumaa nimel.Loomulik,et igauks oma ideoloogia alusel.^igus!Teadagi,et molemil poolel voidelnute hulgas,oli ka sadiste ja kurjategijaid,kes isegi oma eestlasi,sakslasele pugemise eesmargil,valjakoputasid,voi seina aarde panid.Nende kurjategijate parast,ei tohi tervet eesti rahvast suudi moista.Minuarvates,peab eesti justiitsministeerium just neid uksikuid kohtu ala panema.\nMis puutub Vene ulemrabisse,siis las ta tegelgu oma juudikogudusega ja voitlusega kasvava antisemitismi vastu venemaal.Koige absurdsem ongi see,et need tiblajuudid lakuvad venelase taguotsa,samas,kui venelane aina juuti otsib,et oma apardunud majan