{"content_entity_id": 68253, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 167, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 167, "content_entity_sort_nr": 167, "@timestamp": "2018-11-26T23:25:51.942Z", "client_ip": 3651118353, "comment_count_by_submitter": 3, "quote_reg_count": 0, "comment_subject": "asjast ikka to kaera-jaan", "comment_content": "..näe siin ongi su viga-sa ei tee õigeid järeldusi.Ma ei tahtnud siin targutada vaid nõu anda.Mul on autosid nagu jalatseid-igaks elujuhtumiks,ka maju kus elada on vastavalt tahtmisele-mulle jätkub aga ma ei arva et sellepärst rikas olen-kui olen siis sellepärast et pea ja käed on,ja seda mis oskan olengi rikastele müünud mitte käsi pikas pudenemist oodanud.See nõu andmine tuli kogemusest.Kui kõnealuse maja omanikule oleks pakutud varianti pappel maha aga 10 või 100 eestimaist asemele istutada oleks usun nad selle tõrkumata valinud.Aga just selliste ametnike pärast kes &quot;ootasid kutset&quot; kontrollimaks kas puu on murdunud, meil ju neid puid pole.Vaat need ametnikud on vaja minema lüüa kes ei oska inimesi (või siis selle maja elanikud ei olegi!?) rahuldavaid kompromisse leida. Ütlen et ei näinud aga tean et puud murduvad tuules ja nüüd ei näe rusikatega vehkimisel küll mõtet.", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 33039735, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3432062, "publisher_id": 1, "user_id": null, "created_time": "2004-07-24T10:29:18.000Z", "user_sort_nr": null, "comment_content_lemmas": ".. nägema siin olema sina viga-sina ei tegema õige järeldus . mina ei tahtma siin targutama vaid nõu andma . mina olema auto nagu jalatseid-iga elujuhtum , ka maja kus elama olema vastavalt tahtmisele-mulle jätkuma aga mina ei arvama et sellepärst rikas olen-kui olema siis sellepärast et pea ja käsi olema , ja see mis