{"content_entity_id": 67067, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 7762, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 7762, "content_entity_sort_nr": 7762, "@timestamp": "2018-11-26T23:25:51.942Z", "client_ip": 3575904836, "comment_count_by_submitter": 8, "quote_reg_count": 0, "comment_subject": "mõnus!", "comment_content": "*Palun kõigil olla tunnistajaks!&quot;*\n\n_vapustatud, meenutus, 19.07.2004 07:02\nMa isegi tagantjärgi usun, et see oli liba, kuid sa oled käitunud siga-vastikult (See pole ju eriti inetult öeldud?). Räägiksin sinuga hea meelega silmast-silma, aga ma pole sinu tase._\n\nSelle peale pakuti mulle telefoninumber (anonüümsena muide!), millele vastasin:\n_mõnus!, meenutus, 19.07.2004 09:17\nHirmutasid ära?\nKaugeltki mitte!\nKa mina suhtlen inimestega. Täna tööl. Pae 19. \nTelefoni kaudu ma räägin ainult hiinlastega (oli kunagi selline väljend!). Teistega eelistan silmast silma.\nPean mõtlema, mida rääkida? Mõeldud.\nNo ära tule kui sulle aeg nii kallis! Meie jutt oleks u.15 minutit. Aga võibolla ka vähem. Kui rääkimiseks aega leian, siis ainult tööl. Tööväliselt mul vaba aega pole._\n\n_mõnus!, meenutaja, 19.07.2004 10:39\nMina räägin silmast silma. Telefoninumbri riputasid siia üles sina. Aadress pole umbmäärane ja tegelane pole ei-tea-kes.\nKohane meenutada su oma käitumist:\n&quot;Pane palun siia netti üles oma aadress, ma kirjutan sulle ja ütlen, kes olen.&quot; \n\nMa ütlesin, et tahaksin sinuga nelja silma all rääkida. Kuid ma ei öelnud, et see peaks sulle mingi kohustus olema. Hoidku selle eest!_\n\nJa nii on jutt läinud sujuvalt üle Harri Kingole ja tema haavatud uhkusele. \nEi mingit udust aadressi ega tundmatute mõnusa-\nmeenutajate vahelist diplomaatilist mõttevahetust.\n\nOlen praegu kodus ja nagu ütlesin, niivõrd hõivatud, et mingisugune külaliste vastuvõtmine ei tule kõne allagi. Palun vabandust kui keegi vastupidiselt aru sai.", "replyto_comment_