{"content_entity_id": 68309, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 24, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 24, "content_entity_sort_nr": 24, "@timestamp": "2018-11-26T23:25:52.047Z", "client_ip": 3575904664, "comment_count_by_submitter": 2, "quote_reg_count": 0, "comment_subject": "...", "comment_content": "Eesti kui maailma edukaim üleminekuriik?\nBNS l 25. juuli 2004 5:47/ sellesisuline teade Delfis väidab järgmist:\t \n\n„Üleminekuriikide reforme hindava Bertelsmanni transformatsiooniindeksi (BTI) järgi on Eesti maailma kõige edukam üleminekuriik, teatas Deutsche Welle. \nEestile järgnevad Leedu, Tšiili, Botswana, Mali, Slovakkia, Uruguai, Costa Rica, Lõuna-Korea ja Sloveenia.“\n\n\n\nSee teade muidugi on 50% ekslik, sest BTI indeks koosneb kahest iseseisvast alamindeksist: 1) kui kõrge pulga peal riik turumajanduslikult asub (staatus) ja 2) kui sihikindlalt riik pürib redelil kõrgemale (reformimine).\nEsimese indeksi järgi on vaadeldavate siirderiikide hulgas esimene Ungari ja Eesti kuues, ainult teise indeksi järgi on Eesti esimene.\nEsimese indeksi osas kisub Eestit alla nt kasvõi suhteliselt niru teadusrahastamine, teise osas on Eestil ka muidugi nõrku külgi nagu eeskätt elanikkonna etniline lõhestumine.\nNeed indeksid ei ole poliitilised, seega ei meeldi nad ühelegi poliitilisele grupile. Nt nende kahe indeksi mingil kokkukaalumisel oleks siirderiikide hulgas tippude tipuks Leedu.\nTeadlased teavad peale selle, et sellised indeksite väärtused on väga ligikaudsed arvud ja seega annavad nad ainult pildi sellest, kas riik kuulub edukamate, keskmiste või maajääjate klassi. Mingitest esikohtadest rääkimine on teaduslikult täiesti kohatu ja kuulub ainult politikaanide ja ajakirjanike pädevusse.", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 13182299, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3433798, "publisher_id": 1, "user_id": null, "created_time": "2004-07-25T09:20:45.000Z", "user_sort_nr": null, "comment_content_lemmas": "Eesti kui maailm edukaim üleminekuriik ? BNS l 25. juuli 2004 5 : 47 / sellesisuline teade Delfi väitma järgmine : „ üleminekuriik reform hindav Bertelsmann transformatsiooniindeks ( BTI ) järgi olema Eesti maailm kõige edukam üleminekuriik , teatama Deutsche Welle . Eesti järgnema Leedu , Tšiili , Botswana , Mali , Slovakkia , Uruguai , Costa Rica , Lõuna-Korea ja Sloveenia .“ see teade muidugi olema 50 % ekslik , sest BTI indeks koosnema kaks iseseisev alamindeks : 1 ) kui kõrge pulk peal riik turumajanduslikult asuma ( staatus ) ja 2 ) kui sihikindlalt riik pürgima redel kõrgemale ( reformimine ). esimene indeks järgi olema vaadeldav siirderiik hulgas esimene Ungari ja Eesti kuues , ainult teine indeks järgi olema Eesti esimene . esimene indeks osas kiskuma Eesti alla nt kasvõi suhteliselt niru teadusrahastamine , teine osas olema Eesti ka muidugi nõrk külg nagu eeskätt elanikkond etniline lõhestumine . see indeks ei olema poliitiline , seega ei meeldima tema üks poliitiline grupp . Nt see kaks indeks mingi kokkukaalumine olema siirderiik hulgas tipp tipp Leedu . teadlane teadma peale see , et selline indeks väärtus olema väga ligikaudne arv ja seega andma tema ainult pilt see , kas riik kuuluma edukam , keskmine või maajääja klass . mingi esikoht rääkimine olema teaduslikult täiesti kohatu ja kuuluma ainult politikaan ja ajakirjanik pädevus .", "comment_content_clean": {"stats": {"urls": "", "relative_punct": "0_0", "shit_tokens": "", "trigger_words": "", "relative_caps": "0_0", "lang": "et", "text_length": "4", "obfuscated": ""}, "text": "eesti maailm edukaim üleminekuriik ? bns 25. juuli 2004 5 : 47 / sellesisuline teade delfi väitma : „ üleminekuriik reform hindav bertelsmann transformatsiooniindeks ( bti ) eesti maailm edukam üleminekuriik , teatama deutsche welle . eesti järgnema leedu , tšiili , botswana , mali , slovakkia , uruguai , costa rica , lõuna-korea sloveenia .“ teade 50 % ekslik , bti indeks koosnema kaks iseseisev alamindeks : 1 ) kõrge pulk riik turumajanduslikult asuma ( staatus ) 2 ) sihikindlalt riik pürgima redel kõrgemale ( reformimine ). esimene indeks vaadeldav siirderiik esimene ungari eesti kuues , indeks eesti esimene . esimene indeks osas kiskuma eesti nt suhteliselt niru teadusrahastamine , osas eesti nõrk külg eeskätt elanikkond etniline lõhestumine . indeks poliitiline , meeldima poliitiline grupp . nt kaks indeks kokkukaalumine siirderiik tipp tipp leedu . teadlane teadma , indeks väärtus ligikaudne arv andma pilt , riik kuuluma edukam , keskmine maajääja klass . esikoht rääkimine teaduslikult kohatu kuuluma politikaan ajakirjanik pädevus ."}}
