{"content_entity_id": 68147, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 40, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 40, "content_entity_sort_nr": 40, "@timestamp": "2018-11-26T23:25:51.551Z", "client_ip": 3575883243, "comment_count_by_submitter": 4, "quote_reg_count": 0, "comment_subject": "Teine Eestlane", "comment_content": "Kui inimene sunnitakse maha jätma oma kodu, siis jääb ta kodutuks. Eesti Vabariigi ministrid peaksid kodutuse-teemat Eesti Vabariigis valdama. Kui oletatakse, et sotsiaaltoetused uuenevas süsteemis toovad riigile lisakulu 30 miljonit, oleks ehk ratsionaalsem see raha suunata soovijaile omafinantseeringu asenduseks või leida muid võimalusi nendele, kellel iseäranis laste tõttu on terav vajadus oma püsiva kodu järele. \n\nHr majandusminister. Sotsiaalabi ei asenda kodu, millele kõigil eestlastel peaks olema meie põhiseadusest alates võrdne õigus. Võrdsust ei olnud, kui tekitati sundüürnikud. Kui prioriteet tähendab Teie arvates sotsiaalabi, siis tahan Teie tähelepanu juhtida vastupidisele seisukohale: sotsiaalabi ei asenda õiglust, mille järgi igaühel peaksid olema elamisvahendid tema töö, mitte juhuse järgi. \nMina ei tahagi elada omaniku tahtlikult laguneda lastavas majas, kus majaomanik põlgab üürnikke, kuigi teadlikult hankis maja koos selles üürilepingu alusel elavate üürnikega. Kuid ma pean elama, sest mul ei ole raha teist korterit osta; ma ei taha surra, mul on lapsed. Ma ei pea õiglaseks sundüürnike andmist juhuse meelevalda ja sotsiaalabi ülal pidada. Minu tööelu kulus valdavalt okupeeritud Eestis äärmiselt viletsates tingimustes. Ja minu kogu elukogemus, kogu õiglus- ja õigustaju kinnitab, et mina ei ole omas elus halvemini töötanud kui Teie, hr Atonen, või teised vaprad, noored ja ilusad, kellel on kodu, kellele ei ole riiklikult ülekohut tehtud, keda ei ole uusrepresseeritud, kellel on võimalik töötada ja tööga teenida oma koht ka korteriturul, kes kahjuks väga sageli isegi ei vaevu mõtlema muust kui turust ja turuväärtusest. \n\nRaha neelavad kohtuprotsessid, kohtueelsed vaidlused, spetsiaalselt loodavad üürikomisjonid sobivad korteriturule, kuid neid ei ole eetiline pidada normaalseks inimestele, keda koheldi elamureformi käigus ebaõiglaselt. Kui tavakodanik teeb vea, siis ta kas heastab selle või sureb patusena. Kui riik teeb vea, siis riigi kodanikud eeldavad, et riik jääb püsima ja heastab vea igal juhul. \n\nKüsin: Mida ja millal teeb riik sundüürnike vabastamiseks sunnismaisusest?", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 20879276, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3424449, "publisher_id": 1, "user_id": null, "created_time": "2004-07-21T10:07:02.000Z", "user_sort_nr": null, "comment_content_lemmas": "kui inimene sundima maha jätma oma kodu , siis jääma tema kodutu . Eesti vabariik minister pidama kodutuse-teema Eesti vabariik valdama . kui oletama , et sotsiaaltoetus uuenev süsteem tooma riik lisakulu 30 miljon , olema ehk ratsionaalsem see raha suunama soovija omafinantseering asendus või leidma muu võimalus see , kes iseäranis laps tõttu olema terav vajadus oma püsiv kodu järele . Hr majandusminister . sotsiaalabi ei asendama kodu , mis kõik eestlane pidama olema mina põhiseadus algama võrdne õigus . võrdsus ei olema , kui tekitama sundüürnik . kui prioriteet tähendama sina arvama sotsiaalabi , siis tahtma sina tähelepanu juhtima vastupidine seisukoht : sotsiaalabi ei asendama õiglus , mis järgi igaüks pidama olema elamisvahend tema töö , mitte juhus järgi . mina ei tahtma elama omanik tahtlikult lagunema lastav maja , kus majaomanik põlgama üürnik , kuigi teadlikult hankima maja koos see üürileping alune elav üürnik . kuid mina pidama elama , sest mina ei olema raha teine korter ostma ; mina ei tahtma surema , mina olema laps . mina ei pidama õiglane sundüürnik andmine