{"content_entity_id": 67067, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 6845, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 6845, "content_entity_sort_nr": 6845, "@timestamp": "2018-11-26T23:25:51.592Z", "client_ip": 3645317141, "comment_count_by_submitter": 727, "quote_reg_count": 0, "comment_subject": "saadanas", "comment_content": "_Mõtle selle üle: kui kiitus teeb su tühiseks, mida siis veel su enesekiitus sinuga teeb?_\n\nMida tuleks kiita? Mida on enesekiidetud? Mis on saadanas?\nSa pole siiani aru saanud, et saadanast ei ole olemas. Ma ei seo seda mitte ühegi materiaalse ilminguga. Seda mida pole, seda ei saa kiita, see ei saa ennast kiita...\n\nKui sa nüüd püüad kiigata seda ilmingut, kes sellele virtuaalsele saadanasele elu on andnud, siis:\n\n_Võibolla oled sina Maal olnud nii vilets õpilane, et sind on sadu kordi istuma jäetud, ma ei tea..._\n\nKui seda istumajätmiseks kutsuda, siis olen, tõepoolest olen ja ma ei hala mitte ühegi elu pärast mis elatud on. Igaüks neist on mind millegagi rikastanud.\n\n_*Mina* olen siin esimest ja viimast korda._\n\nSul on absoluutselt õigus. Harri Kingo on siin tõepoolest esimest ja viimast korda. Enne seda oli mingi inimhing, kes andis sulle sinu praeguse elu karma ja peale seda jätkab seesama hing selle nartsuga, mille sa talle millalgi tagasi viskad. Mõtle siiski selle üle, et see vaene hingeke peab kõik need haavad ja rebendid mida sa sellesse karmasse tekitanud oled oma higi ja pisaratega ära lappima.\n\n_Ja püüan oma aega kasulikult kasutada._\n\nOled sellega hiilgavalt hakkama saanud. Kogemused mida see inimhing sinult kui praeguse elu peremehelt saab ei unune enam järgmistes eludes iialgi. Mõni kõrvaltvaataja võib ehk seepeale pead vangutada ja imestada, et mida see hing nii hullu on teinud, et tal nüüd nii läheb.\n\n_Sina aga võid vedeleda - sul ju veel sadu kordi ees see üha uuesti 1. klassi minek-tulek, sul aega laialt käes._\n\nEga ikka ei vedele küll. Ma püüan sinusuguseid eksinuid uuesti järje peale aidata...", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 11190922, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3425057, "publisher_id": 1, "user_id": null, "created_time": "2004-07-21T13:45:18.000Z", "user_sort_nr": null, "comment_content_lemmas": "mõtlema see üle : kui kiitus tegema sina tühine , mis siis veel sina enesekiitus sina tegema ? _ mis tulema kiitma ? mis olema enesekiidetud ? mis olema saadan ? sina olema siiani aru saama , et saadan ei olema olema . mina ei siduma see mitte üks materiaalne ilming . see mis olema , see ei saama kiitma , see ei saama ise kiitma ... kui sina nüüd püüdma kiikama see ilming , kes see virtuaalne saadanas elu olema andma , siis : võibolla olema sina Maa olema nii vilets õpilane , et sina olema sada kord istuma jäetud , mina ei teadma ... _ kui see istumajätmine kutsuma , siis olema , tõepoolest olema ja mina ei halama mitte üks elu pärast mis elama olema . igaüks see olema mina miski rikastama . _ * mina * olema siin esimene ja viimane kord . _ sina olema absoluutselt õigus . Harri Kingo olema siin tõepoolest esimene ja viimane kord . enne see olema mingi inimhing , kes andma sina sina praegune elu karma ja peale see jätkama seesama hing see narts , mis sina tema millalgi tagasi viskama . mõtlema siiski see üle , et see vaene hingeke pidama kõik see haab ja rebend mis sina see karma tekitama olema oma higi ja pisar ära lappima . ja püüdma oma aeg kasulikult kasutama . _ olema see hiilgavalt hakkama saama . kogemus mis see inimhing sina kui praegune elu peremees saama ei ununema enam järgmine elu iialgi . mõni kõrvaltvaataja võima ehk seepeale pea vangutama ja imestama , et mis see hing nii hull olema tegema , et tema nüüd nii minema . sina aga või vedelema - sina ju veel sada kord ees see üha uuesti 1. klass minek-tulek , sina aeg laialt käsi . _ ega ikka ei vedelema küll . mina püüdma sinusugune eksinu uuesti järg peale aitama ...", "comment_content_clean": {"stats": {"urls": "", "relative_punct": "0_0", "shit_tokens": "", "trigger_words": "", "relative_caps": "0_0", "lang": "et", "text_length": "4", "obfuscated": "tea._ _*mina korda._ kasutada._ käes._"}, "text": "mõtlema : kiitus tühine , enesekiitus ? _ kiitma ? enesekiidetud ? saadan ? aru , saadan . siduma materiaalne ilming . , kiitma , kiitma . püüdma kiikama ilming , virtuaalne saadanas elu andma , : maa vilets õpilane , sada kord istuma jäetud , teadma . _ istumajätmine kutsuma , , tõepoolest halama elu elama . rikastama . _ * * esimene viimane kord . _ absoluutselt õigus . harri kingo tõepoolest esimene viimane kord . inimhing , andma elu karma jätkama hing narts , viskama . mõtlema , vaene hingeke haab rebend karma tekitama higi pisar lappima . püüdma aeg kasulikult kasutama . _ hiilgavalt . kogemus inimhing elu peremees ununema elu . kõrvaltvaataja seepeale pea vangutama imestama , hing hull , . vedelema - sada kord üha uuesti 1. klass minek-tulek , aeg laialt käsi . _ vedelema . püüdma eksinu uuesti järg aitama ."}}
