{"content_entity_id": 68147, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 241, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 241, "content_entity_sort_nr": 241, "@timestamp": "2018-11-26T23:25:51.593Z", "client_ip": 3563796359, "comment_count_by_submitter": 33, "quote_reg_count": 0, "comment_subject": "Sundüürnik", "comment_content": "Kui sul nii lihtsad lähenemistavad on (ja kui see on nii veel paljudel) teeb see minu eesti rahva tuleviku seisukohalt väga rahutuks. \nSa süüdistad taset, et tema muudab SAMAMOODI tagasi nagu kommunism muutis.\nKas sa oled kuulnud üldinimlikest väärtustest? Et teise asja ei ole kena himustada? Kui sa nii lihtsa asja meeles peaks, ei koliks sa elamisse, mis pole sinu, kui sa kavatsedki sinna jääda ja kui ajutiselt kasutada, siis muidugi bro aga sa annad ta omanikule tagasi. Kas see on nii keeruline?\nNeed, kes nõukogude natsionaliseerimisest kasu lõikasid olid tegelikkuses kuriteo äärepeal aga need, kes tahavad selle võõrandamise muuta püsivaks on selle kuritöö kaassüüdlased ja siin pole midagi targutada. Kui me selliseid väärtusi ei hinda, mis inimtsivilisatsiooni alusteks on näitab see vaid mu rumalust.\nJa eesti rahva seisukohalt annab võimaluse, et ajalugu kordub. Et ei korduks peame me täna olema resoluutsed, et järeltulevad põlved teaks - ühed, et tema omand (kodu) säilib ja teised, kährikud, et neil pole mõtet sisse kolida - lendavad nagunii tänavale.\nPiisavalt selge mõte peaks olema ja siin ei ole erandeid.", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 33994315, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3425081, "publisher_id": 1, "user_id": null, "created_time": "2004-07-21T13:52:29.000Z", "user_sort_nr": null, "comment_content_lemmas": "kui sina nii lihtne lähenemistava olema ( ja kui see olema nii veel palju ) tegema see mina ee