{"content_entity_id": 68153, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 29, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 29, "content_entity_sort_nr": 29, "@timestamp": "2018-11-26T23:25:51.601Z", "client_ip": 1044456298, "comment_count_by_submitter": 1, "quote_reg_count": 0, "comment_subject": "Platoon", "comment_content": "To Klenski, alias Zebra\nPidasin sind siiani inimeseks, kes proovib analüüsida fakte ja siis järeldusi teha, kuid Sinu mitme aasta kommentaaridest on näha, et kaitsed ainult suurvene šovinistlikke seisukohti. \n\nÜldiselt kutsun kommenteerijaid Zebraga mitte väitlema, kuna temale ei mõju ükski ajalooline või loogiline argument, mis tõestab Venemaa ja venelaste pidevat huvi naaberrahvaid anastada ja neid röövides ja hävitades nende kulul elada.\nMul on kõigile küsimus: kuidas leiab Zebra nii palju aega, et saab pidevalt kõiki Venemaad ja rahvusküsimusi puudutavaid artikleid ning kõiki kommentaare lugada ja ka ise pidevalt oma ühepoolseid arvamusi siia kirjutada.\nVastaksin ise kõigepealt sellele küsimusele: Zebrale makstakse selle eest ja kõik saavad aru millisest ilmakaarest selleks raha tuleb. \nMinul muuseas ei ole rohkem aega praegu delfis olla ja tagasi saan tulla alles homme õhtul.", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 1892173, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3425276, "publisher_id": 1, "user_id": null, "created_time": "2004-07-21T14:46:54.000Z", "user_sort_nr": null, "comment_content_lemmas": "To Klenski , alias Zebra pidama sina siiani inimene , kes proovima analüüsima fakt ja siis järeldus tegema , kuid sina mitu aasta kommentaar olema nägema , et kaitse ainult suurvene šovinistlik seisukoht . üldiselt kutsuma kommenteerija Zebra mitte väitlema , kuna tema ei mõjuma ükski ajalooline või loogiline argument , mis tõestama V