{"content_entity_id": 68212, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 67, "subject": null, "content": null, "country_code_id": 1, "content_entity_anonymous_sort_nr": 67, "content_entity_sort_nr": 67, "@timestamp": "2018-11-26T23:25:51.760Z", "client_ip": 3268160257, "comment_count_by_submitter": 27, "quote_reg_count": 0, "comment_subject": "Riinule", "comment_content": "Riinu - vangla sotstöötaja? Wa-au! Siis Sa oled (kui oled?) ju täitsa õige koha peal!\nAga kujutad Sa pilti, et pole minagi sita pealt riisutud ja ma saan väga hästi aru, millest Sa räägid. Öeldu on vihje sellele, et oma mõtete selguse rõhutamiseks ei pea Sa osa sõnu suurendama (ega ka mitte rasvaselt trükkima), ma saan ka tavalisest trükikirjast aru. Või hakkab diskussioon kerge paroodia jumet võtma? Sest üsna naljakas tundub see &quot;ja PUNKT&quot;!\nÜhest asjast saan ma küll aru omamoodi. Nimelt sellest, et Sina vangla sotstöötajana oled sama isekas isiksus kui mina isana. Ole lahke, oma isekusest tingituna võid Sa oma kahjusid ise kanda kui tahad ja oma isekusest tingituna võid Sa pättidele vangimajja vorsti vedada niipalju kui tahad. Ja ma võin väita, et see kõik ei ole sugugi mitte armastusest tingitud.\nAga mina olen niipalju isekas, et julgen öelda, et ma ei taha oma kahjusid ise kanda ja ma ei pea kellelegi vangimajja midagi viima kui ma ei taha viia, olgu tegu või oma lapsega. Vaat nende oma lastega on sihuke lugu, et neile prääniku või piitsa andmine on ikkagi mu enda otsutada - ei üks ega teine pruugi vähendada armastust oma laste vastu. Armastusega kasvatatud tüdruk, kes vaatamata piitsa-prääniku vaheldumisele läheb litsiks, mingugi litsiks ja teenigu endale niimoodi elatist - siis ta ei pea ju enam minu käest taskuraha küsima, eks ole? Armastusega kasvatatud poiss, kes läheb vargile ja keda pubeka eas rihmutada ei tohi - ehk hakkabki kunagi vargaks ja teenib selle ametiga endale ja oma tulevastele lastele elatist. Ja au neile, kes oma oskustega ise ennast ära majandada oskavad ja suudavad! Ja kui vangimaja neile peavarju pakub, siis seda parem! Ega nad ei peagi ju minu katuse all elama. Sellegipoolest võin väita, et kõik eelkirjeldatu ei vähenda minu armastust oma laste vastu. Tõeline armastus toimib ka distantsilt, ega selleks, et kedagi armastada, ei pea temaga päevast päeva ühes ja samas ruumis viibima...", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 25738431, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3428880, "publisher_id": 1, "user_id": null, "created_time": "2004-07-22T20:53:23.000Z", "user_sort_nr": null, "comment_content_lemmas": "Riinu - vangla sotstöötaja ? Wa-au ! siis sina olema ( kui olema ) ju täitsa õige koha peal ! aga kujutama sina pilt , et olema mina sitt pealt riisuma ja mina saama väga hästi aru , mis sina rääkima . öeldu olema vihje see , et oma mõte selgus rõhutamine ei pidama sina osa sõna suurendama ( ega ka mitte rasvaselt trükkima ), mina saama ka tavaline trükikiri aru . või hakkama diskussioon kerge paroodia jume võtma ? sest üsna naljakas tunduma see & quot ; ja punkt & quot ;! üks asi saama mina küll aru omamoodi . nimelt see , et sina vangla sotstöötaja olema sama isekas isiksus kui mina isa . olema lahke , oma isekus tingituna võima sina oma kahi ise kandma kui tahtma ja oma isekus tingituna võima sina pätt vangimaja vorst vedama niipalju kui tahtma . ja mina võima väitma , et see kõik ei olema sugugi mitte armastus tingima . aga mina olema niipalju isekas , et julgema ütlema , et mina ei tahtma oma kahi ise kandma ja mina ei pidama keegi vangimaja miski viima kui mina ei tahtma viima , olema tegu või oma laps . vaat see oma laps olema sihuke lugu , et tema präänik või piits andmine olema ikkagi mina ise otsutama - ei üks ega teine pruukima vähendama armastus oma laps vastu . armastus kasvatama tüdruk , kes vaatamata piitsa-präänik vaheldumine minema lits , minema lits ja teenima ise niimoodi elatis - siis tema ei pidama ju enam mina käest taskuraha küsima , eks olema ? armastus kasvatama poiss , kes minema vargile ja kes pubekas iga rihmutama ei tohtima - ehk hakkama kunagi varas ja teenima see amet ise ja oma tulevane laps elatis . ja au tema , kes oma oskus ise ise ära majandama oskama ja suutma ! ja kui vangimaja tema peavari pakkuma , siis see parem ! ega tema ei pidama ju mina katus all elama . sellegipoolest võima väitma , et kõik eelkirjeldatu ei vähendama mina armastus oma laps vastu . tõeline armastus toimima ka distants , ega see , et keegi armastama , ei pidama tema päev päev ühes ja sama ruum viibima ...", "comment_content_clean": {"stats": {"urls": "", "relative_punct": "0_0", "shit_tokens": "", "trigger_words": "", "relative_caps": "0_0", "lang": "et", "text_length": "4", "obfuscated": ""}, "text": "riinu - vangla sotstöötaja ? wa-au ! ( ) täitsa õige koha ! kujutama pilt , sitt riisuma hästi aru , rääkima . öeldu vihje , mõte selgus rõhutamine osa sõna suurendama ( rasvaselt trükkima ), tavaline trükikiri aru . diskussioon kerge paroodia jume võtma ? naljakas tunduma & quot ; punkt & quot ;! asi aru omamoodi . nimelt , vangla sotstöötaja isekas isiksus isa . lahke , isekus tingituna kahi kandma tahtma isekus tingituna pätt vangimaja vorst vedama niipalju tahtma . väitma , sugugi armastus tingima . niipalju isekas , julgema ütlema , tahtma kahi kandma vangimaja viima tahtma viima , tegu laps . laps lugu , präänik piits andmine otsutama - pruukima vähendama armastus laps . armastus kasvatama tüdruk , piitsa-präänik vaheldumine lits , lits teenima elatis - taskuraha küsima , ? armastus kasvatama poiss , vargile pubekas rihmutama tohtima - varas teenima amet tulevane laps elatis . au , oskus majandama oskama suutma ! vangimaja peavari pakkuma , parem ! katus elama . sellegipoolest väitma , eelkirjeldatu vähendama armastus laps . tõeline armastus toimima distants , , armastama , päev päev ruum viibima ."}}
