{"content_entity_id": 68212, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 161, "subject": null, "content": null, "country_code_id": 1, "content_entity_anonymous_sort_nr": 161, "content_entity_sort_nr": 161, "@timestamp": "2018-11-26T23:25:51.787Z", "client_ip": 3268160257, "comment_count_by_submitter": 27, "quote_reg_count": 0, "comment_subject": "M-ees", "comment_content": "Mitte millekski ei ole garantiid. Loomulikult Sa ei pea kartma oma lapse may-be vrs may-be-not pätistumist ja teda selles hirmus nö ette vitsutama. Loomulikult, et on olemas sada muud karistamisviisi kui vits. Aga see, et saja esimene võib olla ka vits, see vist enam Sinu meelest nii väga loomulik ei ole? Ütlesid õieti, et kõike näitab aeg ja sinnamaani on vaja elada hirmudeta. Aga kas Sa oled praegu moraalselt valmis kõigeks selleks, mida see aeg siis tulevikus Sulle näidata võib? Siis ju polegi sel kõigel, mille üle me siin diskuteerime niiväga tähtsust, kui me jääme lootma juhusele. Juhus võib olla ka sihuke, et sinu võsuke satub kunagi minu maa peale vargile. Ja tore kui see nii juhtuks, sest ma tean, et see on sinu võsuke, ma teen talle pai ja pakun suhkruvett kui vaja... Aga kui ta juhtub minu naabrimehe krundi peale vargile, vaat siis pole teada, mis võib juhtuda (kõik mehed ei ole nii leebed kui mina). Nii et jääme lootma juhusele, eks aeg näitab... Miski ei viita sellele, et minus või minu naabrimehes elementaarne inimlikkus puuduks. Millest üldse selline kõrgelennuline retoorika - elementaarne inimlikkus - Sa ikka tead, millest Sa räägid? Pakun välja, et nimetet asja võivad evida ka kõige paadunumad pätid.\nAga nagu Sa ise oled mitu korda öelnud: garantiid ei ole kunagi...", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 25738431, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3429511, "publisher_id": 1, "user_id": null, "created_time": "2004-