{"content_entity_id": 68221, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 30, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 30, "content_entity_sort_nr": 30, "@timestamp": "2018-11-26T23:25:51.838Z", "client_ip": 1384341560, "comment_count_by_submitter": 2, "quote_reg_count": 0, "comment_subject": "Jesuiit", "comment_content": "Islami ohvreid läbi ajaloo võib vabalt võrrelda natsismi või kommunismiohvritega.\nTekkimisaegne laienemine oli pidev hävitussõda sajandeid\nOmavahelised klaarimised hiljem suht julmad.\nKui võtta seda, et Kuldhord ja enamus mongoleid islamiseerus peale Batu hkaani surma ja milliseid hävitusretki nad korraldasid võib ka selle islami kapsaaeda kirjutada.\nSõjad kristlastega nii läänes kui mujal.\nAlles 17 sajandist alates võib rääkida, et islam ei kujutanud endast Euroopale enam ohtu, kuna lihtsalt oli selgelt nõrgem. \nHiljem trügiti islam Balkanilt välja kuni Konstantinoopolini tagasi.\nVenemaa on neile kõige rohkem aia teinud. Alates Krimmi khaaniriigi hävitamisest, kus tatarlastega nii siva üksnull tehti, et täna küll keegi ei karda, et Krimm võiks slaavlastelt käest lipsata.\nKaukaasia kandis võeti jupp maad Iraanilt ära; Buhaara; Samarkand; Hiiva jne jne.\nAga kristluse võrdlemine islamiga on kohatu. Kristluse hiilgeaeg on praegu. Kas kristlus tapab kedagi? Vastuoksa, ta püüab seda ära hoida.\nIsakese näide ususõdadest ja sellest, et islam on jõudnud praegu sellisesse faasi on väga mööda kähmamine vaadates ajalugu ja mõeldes, et ususõjad käisid meil ikka omavahel, islam ei ähvarda ju praegu sisemiselt vaid on agressiivne ikkagi väljpoole.\nJa selline on ta alati olnud ja selliseks ta jääbki.\nNagu jõud kelleski üle käib, tuleb laksu panna. Prohvet käsib. Ta küll ei luba teiseusulist tappa kui see on nõus oma usu tunnistamise eest maksu maksma aga teiseusuline peab tunnistama oma ülemaks valitsejaks islamiusulise ja ilma islamiusuta territoorium on koht, mida islamiusuline, kui tal on jõudu, on kohustatud hõivama. Kui püha sõda välja kuulutatakse islami laiendamiseks on uskliku kohus sellest osa võtta. \nMis nad praegu Sudaanis teevad??\nNii, et õige. Keelame ära kui sallimatust ja vägivalda propageeriva ürituse.\nPealegi milleks ta meil hea oleks? Et siia veel ka tsurkasi juurde tuleks? Allah akbar.", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 33994315, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3430581, "publisher_id": 1, "user_id": null, "created_time": "2004-07-23T13:33:12.000Z", "user_sort_nr": null, "comment_content_lemmas": "islam ohver läbi ajalugu võima vabalt võrdlema natsism või kommunismiohver . tekkimisaegne laienemine olema pidev hävitussõda sajand omavaheline klaarimine hiljem suht julm . kui võtma see , et kuldhord ja enamus mongol islamiseeruma peale Batu hkaan surm ja milline hävitusretk tema korraldama võima ka see islam kapsaaed kirjutama . sõda kristlane nii lääs kui mujal . alles 17 sajand algama võima rääkima , et islam ei kujutama ise Euroopa enam oht , kuna lihtsalt olema selgelt nõrgem . hiljem trügima islam Balkan välja kuni Konstantinoopol tagasi . Venemaa olema tema kõige rohkem aed tegema . alates Krimm khaaniriik hävitamine , kus tatarlane nii siva üksnull tegema , et täna küll keegi ei kartma , et Krimm võima slaavlane käsi lipsama . Kaukaasia kant võtma jupp maa Iraan ära ; Buhaara ; Samarkand ; Hiiva jne jne . aga kristlus võrdlemine islam olema kohatu . kristlus hiilgeaeg olema praegu . kas kristlus tapma keegi ? vastuoksa , tema püüdma see ära hoidma . isake näide ususõda ja see , et islam olema jõudma praegu selline faas olema väga mööda kähmamine vaatama ajalugu ja mõtlema , et ususõda käima mina ikka omavahel , islam ei ähvardama ju praegu sisemiselt vaid olema agressiivne ikkagi väljpoole . ja selline olema tema alati olema ja selline tema jääma . nagu jõud keegi ü