{"content_entity_id": 68280, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 89, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 89, "content_entity_sort_nr": 89, "@timestamp": "2018-11-26T23:25:52.120Z", "client_ip": 3651114520, "comment_count_by_submitter": 33, "quote_reg_count": 0, "comment_subject": "asotsiaal", "comment_content": "seniil, 25.07.2004 21:04\n#Asotsiaali viga on selles, et tema kriteeriumi järgi on 90% eestlastest vähevõimekad, s.t. ei jõua kulutada 9000 krooni kuus ei laste peale ega lastetusmaksuks, sest nad lihtsalt ei teeni nii palju.#\n\nKuid pole mingit jumala käsku iibepuudeliseks 2- hääbujaks jääda ja siis lastetusmaksu korral lastetu perena 9k rahas teenustööna suurperelisele maksta.\n\nNagu ma olen tähelepanu osutanud, on see 9k pere summaarne panus kolme järglasesse. See koosneb kahest osast, otsesest rahalisest tööl teenitavast panusest järglastesse ning kodus tehtavast ekvivalentsest panusest.\nLinnas 4,5k+4,5k=9k\nmaal 3k+6k=9k\nseega on linnas vaja kahel vanemal teenida kokku laste jaoks 4,5k ja kodus veel 4,5k eest võimelda ning maal ainult 3k sularaha ja 6k eest ekvivalentselt kasvatustööd ja kodumajapidamistööd.\nKui arvestada 6k keskmiseks palgaks, siis kahe vanema peale tuleb 12k. \nSellise palga puhul pole küll võimatu linnas 4,5k panustada piisavasse hulka reaalsetesse lastesse ja maal 3k.\nEga see tööl teenitav raha laste jaoks polegi sageli piirajaks, vaid piirajaks on koduse osa mitteteha tahtmine. Linnas tuleks vanemail ekvivalentselt kodus võimelda 4,5k eest ja maal 6k eest, selle asemel, et selle raha eest lõdvalt ajaviidet tarbida. Sageli põgenetaksegi ju koduse osa eest tööle kohvi jooma, et siis peale tööd lulli lüüa.\n\n#(vt. palkade ja sissetulekute jaotus detsiilide kaupa) Ülejäänud 10% võimekatega aga riiki püsti ei hoia.#\n\nSee sunmmaarne 3k ühe lapse kasvatamise ekvivalentse kuupanusena ja 1,5 miljonit pereküpseks kasvatamise koguekvialendina võimaldab tõesti hinnata tegemata jätmiste suurust, nii igakuist kui ka eluaegset.\n\nNäiteks: kuna meil on 13 vabaduseaastaga sünnitamata jäetud 200k last, siis ei panusta praegune *kaotajate põlvkond* 200kx1,5M=300 miljardit krooni ühiskonna kestmisesse. See 300 miljardine looderdamine ei saa ju ometigi mõjumata jääda. Kui see 200k last oleks kasvatamisel, siis tuleks vanemail nende kasvatamiseks nii tööl kui ka kodus asisemalt pingutada. Laste kasvatamisesse panustatav 300 miljardit läheks põhiliselt kohalikku majandusse, toiduainete tööstusesse, rõivatööstusesse, ehitusse jne. See oleks suur investeering majandusse. Selle asemel kulutavad iibepuudelised pered nüüdsegi vähese raha paljus mittevältimatule välismaisele luksusele ja reisidele, mis vaid suurendab jooksevkonto defitsiiti. Hääbudes iibepuudesse välisvõla kasvades, elatakse ilmselt üle oma võimete. Üks rumalus põhjustab järgmise jne.", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 30802169, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3434956, "publisher_id": 1, "user_id": null, "created_time": "2004-07-25T21:41:45.000Z", "user_sort_nr": null, "comment_content_lemmas": "seniil , 25.07.2004 21 : 04 # asotsiaal viga olema see , et tema kriteerium järgi olema 90 % eestlane vähevõimekas , s.t . ei jõudma kulutama 9000 kroon kuu ei laps peale ega lastetusmaks , sest tema lihtsalt ei teenima nii palju # kuid olema mingi jumal käsk iibepuudeline 2- hääbuja jääma ja siis lastetusmaks korral lastetu pere 9k raha teenustöö suurpereline maksma . nagu mina olema tähelepanu osutama , olema see 9k pere summaarne panus kolm järglane . see koosnema kaks osa , otsene rahaline töö teenitav panus järglane ning kodu tehtav ekvivalentne panus . linn 4,5k + 4,5k = 9k maa 3k + 6k = 9k seega olema linn vaja kaks vanem teenima kokku laps jaoks 4,5k ja kodu veel 4,5k eest võimlema ning maa ainult 3k sularaha ja 6k eest ekvivalents kasvatustöö ja kodumajapidamistöö . kui arvestama 6k keskmine palk , siis kaks vanem peale tulema 12k selline palk puhul olema küll võimatu linn 4,5k panustama piisav hulk reaalne laps ja maa 3k ega see töö teenitav raha laps jaoks olema sageli piiraja , vaid piiraja olema kodune osa mitteteha tahtmine . linn tulema vanem ekvivalents kodu võimlema 4,5k eest ja maa 6k eest , see asemel , et see raha eest lõdvalt ajaviide tarbima . sageli põgenema ju kodune osa eest töö kohv jooma , et siis peale töö lulli lööma . # vt . palk ja sissetulek jaotus detsiil kaupa ) ülejäänu 10 % võimekas aga riik püsti ei hoidma # see sunmmaarne 3k ühe laps kasvatamine ekvivalentne kuupanus ja 1,5 miljon pereküpse kasvatamine koguekvialendina võimaldama tõesti hindama tegemata jätmine suurus , nii igakuine kui ka eluaegne . näide : kuna mina olema 13 vabaduseaasta sünnitamata jäetud 200k laps , siis ei panustama praegune * kaotaja põlvkond * 200kx1,5M = 300 miljard kroon ühiskond kestmine . see 300 miljardine looderdamine ei saama ju ometigi mõjuma jääma . kui see 200k laps olema kasvatamine , siis tulema vanem see kasvatamine nii töö kui ka kodu asisemalt pingutama . laps kasvatamine panustatav 300 miljard minema põhiliselt kohalik majandus , toiduaine tööstus , rõivatööstus , ehitus jne . see olema suur investeering majandus . see asemel kulutama iibepuudeline pere nüüdne vähene raha palju mittevältimatu välismaine luksus ja reis , mis vaid suurendama jooksevkonto defitsiit . hääbuma iibepuu välisvõlg kasvama , elama ilmselt üle oma võime . üks rumalus põhjustama järgmine jne .", "comment_content_clean": {"stats": {"urls": "", "relative_punct": "0_0", "shit_tokens": "", "trigger_words": "", "relative_caps": "0_0", "lang": "et", "text_length": "4", "obfuscated": "s.t"}, "text": "seniil , 25.07.2004 21 : 04 # asotsiaal viga , kriteerium 90 % eestlane vähevõimekas , s.t . jõudma kulutama 9000 kroon kuu laps lastetusmaks , lihtsalt teenima # jumal käsk iibepuudeline 2