{"content_entity_id": 67610, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 130, "subject": null, "content": null, "country_code_id": 1, "content_entity_anonymous_sort_nr": 130, "content_entity_sort_nr": 130, "@timestamp": "2018-11-26T23:24:56.951Z", "client_ip": 3268149497, "comment_count_by_submitter": 1, "quote_reg_count": 0, "comment_subject": "Analüütik", "comment_content": "Mõned vastused:\n\n_Liikluseeskirjade täitmine on vältimatu nõue ja seda ei saa asendada tõkkepuudega_\n\nOn muidugi nõue, aga vaata mis täna hommikul ikkagi juhtus. Kus oli nõuete täitmine? Polnud. Tagajärg? Päris hull, rahalisest matsust pole mõtet rääkidagi, inimelu kaotus on alati korvamatu.\n\n_Pole siin parastada midagi. Olen kindel, et see pole uudis, et autojuhid peavad oma leiva kättesaamiseks töötama 16-18 tundi järjest_\n\nSelle küsimuse peavad lahendama ametiühingud. Tuleks otsida vastust küsimusele, miks Eestis ametiühingud ei toimi. Üks põhjusi on, et eestlane on oma olemuselt individualist. Ta hakkab alles siis tegutsema, kui endal püksid jalas põlevad. Teiste abivajamisele eriti ei reageerita. Ja nii ongi, et kui kedagi ähvardatakse töökohast ilmajätmisega, siis kõik tõmbavad saba jalgevahele ja lasevad enda turjal edasi liugu lasta. Vaadake Euroopa tuumikriikide ametiühinguid. Nad on endale välja VÕIDELNUD normaalsed töö- ja palgatingimused. Muidugi, selleks on neil olnud ka piisvalt aega. Kui eestlased tahavad, et olukord paraneks, tuleb hakata rohkem ühte hoidma. Tuleb lähtuda arusaamast, et see mis juhtub sinu naabrimehele täna, võib sind ennast kollitada juba homme. Ei tohi olla ükskõikne.\n\n_kas Eesti vastavad organid hakkavad ükskord kontrollima töövõtjate töötingimusi ja kõike sellega kaasnevat?_\n\nEi hakka loomulikult, nemad mõtlevad ainult iseenda heaolule. Seda saavad teha ikkagi ainult ametiühingud ise. Organid tuleb panna tegema seda, milleks nad mõeldud on, pideva survega.", "replyto_comment_id": null, "content_entity_main_reg_