{"content_entity_id": 68255, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 294, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 294, "content_entity_sort_nr": 294, "@timestamp": "2018-11-26T23:25:51.913Z", "client_ip": 3557234258, "comment_count_by_submitter": 5, "quote_reg_count": 0, "comment_subject": "Zebra", "comment_content": "&quot;Mina õiguslikul tasandil probleeme ei näe.Seadusi pole rikutud.Inimõigusi pole rikutud.Õigus saada elukohariigi kodakonsust ei ole inimõigus.Poliitikas vaidlemine on mõttetu.Siin valitseb enamasti tugevama õigus.Eks tulevik näitab,kellel on õigus.&quot;\n..\nõigemini - sa ei soovi näha. Pigistad silmad kinni. Seepärast rahvusvahelised organisatsioonid, selle jaoks loodud organisatsioonid, osutavadki probleemide olemasolule, enne kui need kasvavad üle pea.\nAga probleem, ükskõik mis kategoorias sa seda soovid näidata, on suur: inimesed on mures, tunnevad ennast riivatuna, tunnevad ennast madalamal trepiastmel kui teised elanikud, samas ei tunne mingit süüd, mille eest neid võiks karistada. Kui sinu suhtumises nende muresse on teatud kättemaksu element (mis on isegi mingil määral arusaadav) siis rahvusvahelised instantsid ei võta sellist aspekti arvesse, ei õiguslikul, ega poliitilisel tasandil. Sinu ponnistused seda läbi suruda on a priori määratud läbikukkumisele - see ei lähe Euroopas läbi. \nEetilises aspektis ei ole mure sinu poolt aimatav -sa oled kõrgemal trepiastmel, see on selge, ent see probleem on hästi nähtav teistele.", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 32774612, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3431412, "publisher_id": 1, "user_id": null, "created_time": "2004-07-23T20:05:52.000Z", "user_sort_nr": null, "comment_content_lemmas": "& quot ; mina õiguslik tasand probleem ei nägema . seadus olema rikkuma . inimõigus olema rikkuma . õigus saama elukohariik kodakonsus ei olema inimõigus . poliitika vaidlemine olema mõttetu . siin valitsema enamasti tugevam õigus . eks tulevik näitama , kes olema õigus & quot ; .. õigemini - sina ei soovima nägema . pigistama silm kinni . seepärast rahvusvaheline organisatsioon , see jaoks loodud organisatsioon , osutama probleem olemasolu , enne kui see kasvama üle pea . aga probleem , ükskõik mis kategooria sina see soovima näitama , olema suur : inimene olema mure , tundma ise riivatu , tundma ise madalam trepiaste kui teine elanik , sama ei tundma mingi süü , mis eest see võima karistama . kui sina suhtumine tema mure olema teadma kättemaks element ( mis olema isegi mingi määr arusaadav ) siis rahvusvaheline instants ei võtma selline aspekt arve , ei õiguslik , ega poliitiline tasand . sina ponnistus see läbi suruma olema a prior määrama läbikukkumine - see ei minema Euroopa läbi . eetiline aspekt ei olema mure sina poolt aimatav sina olema kõrgem trepiaste , see olema selge , ent see probleem olema hästi nähtav teine .", "comment_content_clean": {"stats": {"urls": "", "relative_punct": "0_0", "shit_tokens": "", "trigger_words": "", "relative_caps": "0_0", "lang": "et", "text_length": "4", "obfuscated": "näe.seadusi rikutud.inimõigusi rikutud.õigus inimõigus.poliitikas mõttetu.siin õigus.eks"}, "text": "& quot ; õiguslik tasand probleem nägema . seadus rikkuma . inimõigus rikkuma . õigus elukohariik kodakonsus inimõigus . poliitika vaidlemine mõttetu . valitsema enamasti tugevam õigus . tulevik näitama , õigus & quot ; . õigemini - soovima nägema . pigistama silm kinni . rahvusvaheline organisatsioon , loodud organisatsioon , osutama probleem olemasolu , kasvama pea . probleem , kategooria soovima näitama , suur : inimene mure , tundma riivatu , tundma madalam trepiaste elanik , tundma süü , karistama . suhtumine mure teadma kättemaks element ( määr arusaadav ) rahvusvaheline instants võtma aspekt arve , õiguslik , poliitiline tasand . ponn