{"content_entity_id": 68276, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 72, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 72, "content_entity_sort_nr": 72, "@timestamp": "2018-11-26T23:25:51.945Z", "client_ip": 1357592245, "comment_count_by_submitter": 6, "quote_reg_count": 0, "comment_subject": "Graal", "comment_content": "See, et mõnd hälvet kusagil kirjas ei ole, ei tee hälvet veel olematuks. Ametlikult näiteks on ka Eestis kõik kõige paremas korras nn vähemuste suhtes, ometigi oleme praegu tohutu Vene propaganda rünnaku all. Ametlikult on Eesti ääretult tolerantne maa aga ometigi sinusugused sõimavad seda maad ja rahvast homofoobiliseks.\nEt juhindud mingist inimeste poolt väljamõeldud seadusetähest näitab sinu silmakirjalikkust.\n\n/--Ja andeks, aga kuskohas on kirjas, et homode tegevus saatana vili on? Paluks äkki täpset tsitaati??--/\n\nLoe hoolega Vana Testamenti, eriti Moosese 3. raamatut, milles samasooliste vahelist seksuaalset suhtlemist Jumal surmaga ähvardab.\nKa Soodoma ja Komorra loost(Gen 1) jookseb sama motiiv läbi nende linnade elanike kõlbelisest allakäigust.\nNii, et pole mõtet tulla vehklema siia ideega, et see homofiilia mingi inimkonna kõrgem arenguaste oleks.\nTegelikult on see esimene allakäigu aste. Ja ma kardangi, et selline sallivus Lääne kultuuriilmas hävitab selle ning juba sel sajandil võtavad maailmas juhtpositsiooni straighthetero-suunaga hiinlased ja moslemid, kuna homofiilne lääne kultuur pole enam võimeline kvaliteetset inimkonda produtseerima.", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 34006947, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 3432137, "publisher_id": 1, "user_id": null, "created_time": "2004-07-24T11:08:42.000Z", "user_sort_nr": null, "comment_content_lemmas": "see , et mõni hälve kusagil kiri ei olema , ei tegema häl