{"content_entity_id": 126323, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 13, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 13, "content_entity_sort_nr": 13, "@timestamp": "2018-11-27T02:27:43.271Z", "client_ip": 3575881918, "comment_count_by_submitter": 1, "quote_reg_count": 0, "comment_subject": "Kalvis", "comment_content": "Analoogtelevisioon tuleks võimalikult kaua elus hoida. Esiteks, kes digi nautida tahavad on selleks võimalus täna olemas. Olen vaadanud, kuid kahjuks pilt on kehva võrreldes analoogtelevisiooniga. Teiseks on analoogtelevisiooni seadmed täna väga odavad. Ma pole huvitatud käima palju pappi välja palju sitema digitelevisiooni eest, kui analoogTV saab täitsa tasuta.\nKolmandaks öeldi õieti - digiseadmete hind kukub kolinal lähiajal, sest tootjaid tuleb nagu seeni peale vihma. Praegu on sobivate seadmete hinnad konkurentsi puuduse tõttu ebamõistlikult kõrged.\nSeaduse taga ongi ärimehed, kes pole rahul oma kesiste tulemustega müügil digivallas. Tavainimeste jaoks on tegu projektiga, kus järjekordselt lollikesed peavad ilma jääma oma rahast.\n\nOlin alles hiljuti Helsingis. Oli jalgpallimats soome digikanalil. No nii sitta digipilti annab ikka vaadata kui 1 sek on ülekanne ja siis 1 sek ruudulist pilti. Nagu kiuste kõik värava löömised sattusid just ruudulisse aega, sest sel hetkel pildi datavoog ületab ülekande riba edastusvõime ning pilt kukub ära. Kui peesitati niisama väljakul siis oli pilt OK. Kohe kui tekkis liikumine polnud pilti.", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 86590244, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 7121167, "publisher_id": 1, "user_id": null, "created_time": "2008-06-16T15:18:32.000Z", "user_sort_nr": null, "comment_content_lemmas": "analoogtelevisioon tulema võimalikult kaua elu hoidma . esiteks , kes digi nautima t