{"content_entity_id": 126349, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 122, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 122, "content_entity_sort_nr": 122, "@timestamp": "2018-11-27T02:27:43.284Z", "client_ip": 3287984138, "comment_count_by_submitter": 2, "quote_reg_count": 0, "comment_subject": "Peeedu", "comment_content": "Keegi siin väitis, et tänu Savisaarele meil ei ole talonge. Kahjuks lapsekesed tänu Savisaare äraminekule peaministri kohALT POLE MEIL TALONGE. Kui hindu püüti hoida kunstlikult siis oli nälg majas. kohe kui raha muutus õigeks rahaks siis lõppes krooni tulekuga see jama üleöö. savisaar oli tookord krooni vastane ja tahtis teha ülemineku raha. Nagu lätis hiljem. Eesti sai tol hetkel kuigi Riia oli ja on läbi ajaloo Baltikumi keskus parema stardi. \nMiskit ei takista kapitalistil mõnda aega oma juurdehindlust nii madala hoida, et munitsipaalpood kõrbeks oma kõrgete hindadega. Pigem lepiksid kõik ketid kokku, et selline ebaterve konkurents tuleks surnuks võistelda. Ja vahe maksae kinni meie omast rahast ja midagi jääb siis riigi käest saamata.", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 88600036, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 7121340, "publisher_id": 1, "user_id": null, "created_time": "2008-06-16T16:00:53.000Z", "user_sort_nr": null, "comment_content_lemmas": "keegi siin väitma , et tänu Savisaar mina ei olema talong . kahjuks lapseke tänu Savisaar äraminek peaminister koha olema mina talong . kui hind püüdma hoidma kunstlikult siis olema nälg maja . kohe kui raha muutuma õige raha siis lõppema kroon tulek see jama üleöö . savisaar olema tookord kroon vastane ja tahtma tegema üleminek raha . nagu lätis hiljem . Eesti saama too hetk kuigi Riia olema ja olema läbi ajalugu Baltikum keskus parem start . miski ei takistama kapitalist mõn