ik . mina ei võtma siinkohal seisukoht , olema iirlane otsus õige või vale . kui küsimus olema niimoodi püstitama , olema see loogiline tulemus . kõik selline otsus olema alati läbi kukkuma rahvahääletus . seega eelkõige Iirimaa valitsus ja EL juhtkond läbikukkumine .", "comment_content_clean": {"stats": {"urls": "", "relative_punct": "0_0", "shit_tokens": "", "trigger_words": "", "relative_caps": "0_0", "lang": "et", "text_length": "3", "obfuscated": ""}, "text": "demokraatia iirimaa . , huvitama , üldse hääletama rahvas üldse lissabon lepe teadma ? , teadma lissabon lepe rahvas , sh lepe vastane ? asi , keerulisem asi põhjalaskmine vaja , panema asi rahvahääletus ! savisaar teadma näiteks priimalt . maksma keeruline asi lootma eeldama , rahvahääletus tulemus asi mõistlik . võtma seisukoht , iirlane otsus õige vale . küsimus püstitama , loogiline tulemus . otsus kukkuma rahvahääletus . iirimaa valitsus el juhtkond läbikukkumine ."}, "texta_facts": [{"spans": "[[0, 0]]", "str_val": "bar", "fact": "TEEMA", "doc_path": "comment_content"}]}
