{"content_entity_id": 126244, "replyto_sort_nr": -1, "is_enabled": true, "content_entity_main_anon_sort_nr": 42, "subject": null, "content": null, "country_code_id": 0, "content_entity_anonymous_sort_nr": 42, "content_entity_sort_nr": 42, "@timestamp": "2018-11-27T02:27:42.997Z", "client_ip": 1489245654, "comment_count_by_submitter": 2, "quote_reg_count": 0, "comment_subject": "Prantsusmaa", "comment_content": "Radikaalsed moslemid peavad Prantsusmaal välja kuulutamata intifadat politsei ja riigivõimu vastu, iga päev saab vägivaldsetes kokkupõrgetes haavata kesmiselt 14 politseiniku.\n\nPrantsuse siseminiseeriumi teatel on sel aastal moslemite rünnakutes saanud haavata ligi 2500 politseiniku, teatab The Telegraph.\nPolitsei ametiühing teatas, et nende liikmed on „kodusõja olukorras“ ning situsatsioon on kõige hirmsam Aafrikast pärit moslemitega tihedalt asustatud eeslinna slummides ehk banlieue’des.\nAmetiühingute sõnul on olukord sedavõrd hull, et nad on pöördunud valitsuse poole palvega eraldada soomukeid patrullidele, kes ei julge enam muidu liikuda teatud piirkondades.\nViimase kahe aasta jooksul on rünnakute hulk kasvanud kolmandiku võrra ning kadunud on ajad, mil Prantsusmaal kehtis mitteametlik tabu patrullis olevaid politseinike rünnata. Vastupidi, niipea kui politseinikud üritavad mõnda isikut vahistada, rünnatakse neid kohaliku rahvahulga poolt. Eriti ohtlik on politseil liikuda mõneinimeselistes patrullides.\nKui valitsus üritab asja näidata vaid kuritegevusevastase võitlusena, siis paljud politseinikud kinnitavad, et tegu on islamiäärmuslaste ülestõusuga Prantsuse riigi vastu. Ühe ametiühingu peasekretär Michel Thoomis kirjutas siseministrile, et eeslinnades on sisuliselt käimas intifada ehk ülestõus ning nõudis, et üksustele antaks kõige ohtlikemates piirkondades soomukid.\n„Me oleme kodusõja tingimustes, mida korraldavad radikaalsed islamistid. See ei ole enam linnavägivalla küsimus, see on intifada, kus kasutatakse kive ja molotovi kokteile. Enam ei ole näha kahte-kolme noorukit politseile vastu astumas, näha on tervet korrusamaja tänavale jooksmas, et päästa oma seltsimehi vahistamisest,“ räägib Thoomis. Tema sõnul on vaja soomukeid ja veekahureid, et laiali ajada sadu inimesi, kes üritavad pidevalt politseinike tappa ja nende sõidukeid põlema panna.", "replyto_comment_id": null, "content_entity_main_reg_sort_nr": -1, "content_entity_registered_sort_nr": -1, "client_cookie": 83291059, "channel_id": 1, "is_anonymous": true, "@version": "1", "quote_count": 0, "id": 7117588, "publisher_id": 1, "user_id": null, "created_time": "2008-06-14T12:31:16.000Z", "user_sort_nr": null, "comment_content_lemmas": "radikaalne moslem pidama Prantsusmaa välja kuulutama intifada politsei ja riigivõim vastu , iga päev saama vägivaldne kokkupõrge haavama kesmiselt 14 politseinik . prantsuse siseminiseerium teade olema see aasta moslem rünnak saama haavama ligi 2500 politseinik , teatama The Telegraph . politsei ametiühing teatama , et tema liige olema „ kodusõda olukord “ ning situsatsioon olema kõige hirmsam Aafrika pärit moslem tihedalt asustama eeslinn slumm ehk banlieue ’ des . ametiühing sõna olema olukord sedavõrd hull , et tema olema pöörduma valitsus poole palve eraldama soomuk patrull , kes ei julgema enam muidu liikuma teadma piirkond . viimane kaks aasta jooksul olema rünnak hulk kasvama kolmandik võrra ning kaduma olema aeg , mil Prantsusmaa kehtima mitteametlik tabu patrullima olev politseinik ründama . vastupidi , niipea kui politseinik üritama mõni isik vahistama , ründama see kohalik rahvahulk poolt . eriti ohtlik olema politsei liikuma mõneinimeseline patrull . kui valitsus üritama asi näitama vaid kuritegevusevastane võitlus , siis palju politseinik kinnitama , et tegu olema islamiäärmuslane ülestõus prantsuse riik vastu . Ühe ametiühing peasekretär Michel Thoomis kirjutama siseminister , et eeslinn olema sisuliselt käima intifada ehk ülestõus ning nõudma , et üksus andma kõige ohtlikem piirkond soomuk . „ mina ole